var title_f6_27_6581="Inducing blister";
var content_f6_27_6581=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=DERM%2F60027&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F60027&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 603px\">",
"   <div class=\"ttl\">",
"    How to induce a blister before biopsy for epidermolysis bullosa",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 583px; height: 281px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) Rub the normal skin with twisting movements of a pencil eraser for a few seconds and repeat. The skin should not peel. Recheck the area intermittently for redness and vesiculation before performing the biopsy.",
"    <br>",
"     (B) This is the degree of redness and vesiculation needed before taking the 3 mm punch biopsy for immunofluorescence mapping in the vesiculated area. The 2 mm punch biopsy for electron microscopy may be taken from this area also.",
"     <div class=\"footnotes\">",
"     </div>",
"     <div class=\"reference\">",
"     </div>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
