"     12 mg (60): $275.94",
"    </p>",
"   </div>",
"   <div class=\"block mop drugH1Div\" id=\"F175146\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Mental status",
"    </p>",
"   </div>",
"   <div class=\"list fbnlist drugH1Div drugBrandNames\" id=\"F175158\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Galamer (IN);",
"     </li>",
"     <li>",
"      Gatamine (TW);",
"     </li>",
"     <li>",
"      Nivalin (BG, DE, HU, PL, RU);",
"     </li>",
"     <li>",
"      Proneurax (VE);",
"     </li>",
"     <li>",
"      Remember (TW);",
"     </li>",
"     <li>",
"      Reminyl (AR, AT, AU, BE, BR, CH, CL, CO, CR, CZ, DE, DK, DO, EE, ES, FI, FR, GB, GR, GT, HN, ID, IE, IL, IT, MX, MY, NI, NL, NO, NZ, PA, PE, PH, PT, SE, SG, SV, TH, TR, TW, UY);",
"     </li>",
"     <li>",
"      Reminyl ER (CN, CO, EC);",
"     </li>",
"     <li>",
"      Reminyl LP (FR);",
"     </li>",
"     <li>",
"      Reminyl PRC (HK, IL);",
"     </li>",
"     <li>",
"      Reminyl XL (GB, IE);",
"     </li>",
"     <li>",
"      Shi Wei Bao (CL);",
"     </li>",
"     <li>",
"      Tamirin SR (KP)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F175137\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Centrally-acting cholinesterase inhibitor (competitive and reversible). It elevates acetylcholine in cerebral cortex by slowing the degradation of acetylcholine. Modulates nicotinic acetylcholine receptor to increase acetylcholine from surviving presynaptic nerve terminals. May increase glutamate and serotonin levels.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F175152\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Duration: 3 hours; maximum inhibition of erythrocyte acetylcholinesterase ~40% at 1 hour post 8 mg oral dose; levels return to baseline at 30 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Rapid and complete",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: 175 L; levels in the brain are 2-3 times higher than in plasma",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: 18%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hepatic; linear, CYP2D6 and 3A4; metabolized to epigalanthaminone and galanthaminone both of which have acetylcholinesterase inhibitory activity 130 times less than galantamine",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: ~90%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: ~7 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak: Immediate release: 1 hour (2.5 hours with food); extended release: 4.5-5 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (20%)",
