var title_f6_27_6587="Criteria for asphyxial CP";
var content_f6_27_6587=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F66304&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F66304&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Criteria for acute intrapartum events sufficient to cause cerebral palsy",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        All four criteria must be met:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Evidence of metabolic acidosis: umbilical artery pH &lt;7 and base deficit &ge;12 mmol/L at delivery",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Early onset of severe or moderate neonatal encephalopathy in infants &ge;34 weeks of gestation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cerebral palsy of the spastic quadriplegic or dyskinetic type",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Exclusion of other identifiable etiologies (eg, trauma, coagulation disorders, infection, genetic disorders)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Task force on neonatal encephalopathy and cerebral palsy, American College of Obstetricians and Gynecologists (ACOG). Neonatal Encephalopathy and Cerebral Palsy: Executive Summary. Obstet Gynecol 2004; 103:780.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
