var title_f6_27_6588="Localization diverticular bleed";
var content_f6_27_6588=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F74147&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F74147&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Procedures used for evaluation of lower gastrointestinal bleeding",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"3\" width=\"33%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Technique",
"       </td>",
"       <td class=\"subtitle1\">",
"        Advantages",
"       </td>",
"       <td class=\"subtitle1\">",
"        Disadvantages",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Radionuclide imaging",
"       </td>",
"       <td>",
"        <p>",
"         Noninvasive",
"        </p>",
"        <p>",
"         Sensitive to low rates of bleeding",
"        </p>",
"        Can be repeated for intermittent bleeding",
"       </td>",
"       <td>",
"        <p>",
"         Has to be performed during active bleeding",
"        </p>",
"        <p>",
"         Poor localization of bleeding site",
"        </p>",
"        <p>",
"         Not therapeutic",
"        </p>",
"        Not widely available",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        CT angiography",
"       </td>",
"       <td>",
"        <p>",
"         Noninvasive",
"        </p>",
"        <p>",
"         Accurately localizes bleeding source",
"        </p>",
"        <p>",
"         Provides anatomic detail",
"        </p>",
"        Widely available",
"       </td>",
"       <td>",
"        <p>",
"         Has to be performed during active bleeding",
"        </p>",
"        <p>",
"         Not therapeutic",
"        </p>",
"        Radiation and IV contrast exposure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Angiography",
"       </td>",
"       <td>",
"        <p>",
"         Accurately localizes bleeding source",
"        </p>",
"        <p>",
"         Therapy possible with super-selective embolization",
"        </p>",
"        Does not require bowel preparation",
"       </td>",
"       <td>",
"        <p>",
"         Has to be performed during active bleeding",
"        </p>",
"        Potential for serious complications",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Colonoscopy",
"       </td>",
"       <td>",
"        <p>",
"         Precise diagnosis and localization regardless of active bleeding or type of lesion",
"        </p>",
"        Endoscopic therapy is possible",
"       </td>",
"       <td>",
"        <p>",
"         Need colon preparation for optimal visualization",
"        </p>",
"        <p>",
"         Risk of sedation in acutely bleeding patient",
"        </p>",
"        Definite bleeding source (stigmata) infrequently identified",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CT: Computed tomographic; IV: intravenous.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
